import React from 'react'

const SearchImage = () => {
    const styles ={
        maindiv:{
            backgroundColor:'red',
            marginTop:'50px',
            display:'flex',
            justifyContent:'center',
        }
    }
  return (
    <div>
        <div style={styles.maindiv} className="mainDiv">
        <div>
        <label htmlFor="">Get Images</label>
        </div>
        <div>
            <input type="text" />
            </div>
        </div>
    </div>
  )
}

export default SearchImage
